class Solution {
    /**
    For a given list of integers, return a tuple consisting of a sum and a product of all the integers in a list.
    Empty sum should be equal to 0 and empty product should be equal to 1.
    >>> sum_product(List.of())
    [0, 1]
    >>> sum_product(Arrays.asList(1, 2, 3, 4))
    [10, 24]
     */
    public List<Integer> sum_product(List<Integer> numbers) {
        if (numbers.isEmpty()) {
            return Arrays.asList(0, 1);
        }

        int totalSum = 0;
        int product = 1;

        for (int num : numbers) {
            totalSum += num;
            product *= num;
        }

        return Arrays.asList(totalSum, product);
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.sum_product(new ArrayList<>(List.of())).equals(Arrays.asList(0, 1)),
                s.sum_product(new ArrayList<>(Arrays.asList(1, 1, 1))).equals(Arrays.asList(3, 1)),
                s.sum_product(new ArrayList<>(Arrays.asList(100, 0))).equals(Arrays.asList(100, 0)),
                s.sum_product(new ArrayList<>(Arrays.asList(3, 5, 7))).equals(Arrays.asList(3 + 5 + 7, 3 * 5 * 7)),
                s.sum_product(new ArrayList<>(List.of(10))).equals(Arrays.asList(10, 10))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

