    >>> has_close_elements(Arrays.asList(1.0, 2.0, 3.0), 0.5)
    false
    >>> has_close_elements(Arrays.asList(1.0, 2.8, 3.0, 4.0, 5.0, 2.0), 0.3)
    true
     */
    public boolean has_close_elements(List<Double> numbers, double threshold) {
        // Sort the list to ensure that we can efficiently check consecutive elements for closeness.
        Collections.sort(numbers);

        // Iterate through the sorted list and compare each pair of adjacent elements.
        for (int i = 0; i < numbers.size() - 1; i++) {
            if (Math.abs(numbers.get(i) - numbers.get(i + 1)) < threshold) {
                return true;
            }
        }

        // If no pairs are found that satisfy the condition, return false.
        return false;
    }
}

