class Solution {
    /**
     * Evaluates polynomial with coefficients xs at point x.
     */
    public double poly(List<Double> xs, double x) {
        double result = 0;
        for (int i = 0; i < xs.size(); i++) {
            result += xs.get(i) * Math.pow(x, i);
        }
        return result;
    }

    /**
     * Evaluates polynomial with coefficients xs at point x.
     */
    public double find_zero(List<Double> xs) {
        if (xs.size() % 2 != 0) {
            throw new IllegalArgumentException("The list must have an even number of coefficients.");
        }

        // Use the bisection method to find a root of the polynomial.
        double low = -1000;
        double high = 1000;

        while (poly(xs, low) * poly(xs, high) > 0) {
            low *= 2;
            high *= 2;
        }

        final double tolerance = 1e-7;
        double mid = (low + high) / 2.0;
        while (Math.abs(poly(xs, mid)) > tolerance) {
            if (poly(xs, low) * poly(xs, mid) < 0) {
                high = mid;
            } else {
                low = mid;
            }
            mid = (low + high) / 2.0;
        }

        return mid;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        Random rand = new Random(42);
        for (int i = 0; i < 100; i++) {
            int ncoeff = 2 * (rand.nextInt(3) + 1);
            List<Double> coeffs = new ArrayList<>();
            for (int j = 0; j < ncoeff; j++) {
                int coeff = rand.nextInt(20) - 10;
                if (coeff == 0) {
                    coeff = 1;
                }
                coeffs.add((double) coeff);
            }
            double solution = s.find_zero(coeffs);
            if (Math.abs(s.poly(coeffs, solution)) > 1e-4) {
                throw new AssertionError();
            }
        }
    }
}

