     [3, 6, 5, 4]
      */
    public List<Integer> sort_even(List<Integer> l) {
        ArrayList<Integer> evenIndicesValues = new ArrayList<>();

        // Collect values at even indices
        for (int i = 0; i < l.size(); i += 2) {
            evenIndicesValues.add(l.get(i));
        }

        // Sort the collected even-indexed values
        Collections.sort(evenIndicesValues);

        List<Integer> result = new ArrayList<>(l);

        // Replace even indices with sorted values
        for (int i = 0, j = 0; i < l.size(); i += 2, j++) {
            result.set(i, evenIndicesValues.get(j));
        }

        return result;
    }
}

