class Solution {
    /**
     * Return 2^n modulo p (be aware of numerics).
     * >>> modp(3, 5)
     * 3
     * >>> modp(1101, 101)
     * 2
     * >>> modp(0, 101)
     * 1
     * >>> modp(3, 11)
     * 8
     * >>> modp(100, 101)
     * 1
     */
    public int modp(int n, int p) {
        return (int)modPow(2L, n, p);
    }

    private long modPow(long base, long exp, long modulus) {
        if (modulus == 1) return 0;
        long result = 1;
        base = base % modulus;
        while (exp > 0) {
            if ((exp & 1) == 1)
                result = (result * base) % modulus;
            exp >>= 1;
            base = (base * base) % modulus;
        }
        return result;
    }
}

