class Solution {
    /**
    Circular shift the digits of the integer x, shift the digits right by shift
    and return the result as a string.
    If shift > number of digits, return digits reversed.
    >>> circular_shift(12, 1)
    "21"
    >>> circular_shift(12, 2)
    "12"
     */
    public String circular_shift(int x, int shift) {
        List<Character> digits = new ArrayList<>();

        // Convert integer to list of characters (digits)
        while (x > 0) {
            digits.add(0, (char)(x % 10 + '0'));
            x /= 10;
        }

        int numDigits = digits.size();

        // If shift is greater than or equal to number of digits, reverse the digits
        if (shift >= numDigits) {
            Collections.reverse(digits);
            return digits.stream().map(String::valueOf).collect(Collectors.joining());
        }

        // Perform circular shift
        int actualShift = shift % numDigits;  // Effective shift within the length of the number

        List<Character> shiftedDigits = new ArrayList<>(digits.subList(numDigits - actualShift, numDigits));
        shiftedDigits.addAll(digits.subList(0, numDigits - actualShift));

        return shiftedDigits.stream().map(String::valueOf).collect(Collectors.joining());
    }
}

