    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.triangle_area(3, 4, 5) == 6.00,
                s.triangle_area(1, 2, 10) == -1,
                s.triangle_area(4, 8, 5) == 8.18,
                s.triangle_area(2, 2, 2) == 1.73,
                s.triangle_area(1, 2, 3) == -1,
                s.triangle_area(10, 5, 7) == 16.25,
                s.triangle_area(2, 6, 3) == -1,
                s.triangle_area(1, 1, 1) == 0.43,
                s.triangle_area(2, 2, 10) == -1
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

