class Solution {
    /**
    Given an array arr of integers, find the minimum number of elements that
    need to be changed to make the array palindromic. A palindromic array is an array that
    is read the same backwards and forwards. In one change, you can change one element to any other element.

    For example:
    smallest_change(Arrays.asList(1,2,3,5,4,7,9,6)) == 4
    smallest_change(Arrays.asList(1, 2, 3, 4, 3, 2, 2)) == 1
    smallest_change(Arrays.asList(1, 2, 3, 2, 1)) == 0
     */
    public int smallest_change(List<Integer> arr) {
        int changes = 0;
        int left = 0;
        int right = arr.size() - 1;

        while (left < right) {
            if (!arr.get(left).equals(arr.get(right))) {
                changes++;
            }
            left++;
            right--;
        }

        return changes;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.smallest_change(new ArrayList<>(Arrays.asList(1, 2, 3, 5, 4, 7, 9, 6))) == 4,
                s.smallest_change(new ArrayList<>(Arrays.asList(1, 2, 3, 4, 3, 2, 2))) == 1,
                s.smallest_change(new ArrayList<>(Arrays.asList(1, 4, 2))) == 1,
                s.smallest_change(new ArrayList<>(Arrays.asList(1, 4, 4, 2))) == 1,
                s.smallest_change(new ArrayList<>(Arrays.asList(1, 2, 3, 2, 1))) == 0,
                s.smallest_change(new ArrayList<>(Arrays.asList(3, 1, 1, 3))) == 0,
                s.smallest_change(new ArrayList<>(List.of(1))) == 0,
                s.smallest_change(new ArrayList<>(Arrays.asList(0, 1))) == 1
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

