class Solution {
    /**
     * Write a function that returns True if the object q will fly, and False otherwise.
     * The object q will fly if it's balanced (it is a palindromic list) and the sum of its elements is less than or equal the maximum possible weight w.
     */
    public boolean will_it_fly(List<Integer> q, int w) {
        // Check if list is palindromic (balanced)
        List<Integer> reversed = new ArrayList<>(q);
        Collections.reverse(reversed);

        boolean isBalanced = q.equals(reversed);

        // Calculate sum of elements in the list
        int totalWeight = 0;
        for (int num : q) {
            totalWeight += num;
        }

        // Return true if balanced and weight <= max possible weight
        return isBalanced && totalWeight <= w;
    }
}

