                letterGrades.add("A-");
            } else if (grade > 3.0) {
                letterGrades.add("B+");
            } else if (grade > 2.7) {
                letterGrades.add("B");
            } else if (grade > 2.3) {
                letterGrades.add("B-");
            } else if (grade > 2.0) {
                letterGrades.add("C+");
