                letterGrades.add("C-");
            } else if (grade > 1.0) {
                letterGrades.add("D+");
            } else if (grade > 0.7) {
                letterGrades.add("D");
            } else if (grade > 0.0) {
                letterGrades.add("D-");
            } else {
                letterGrades.add("E");
            }
        }
        return letterGrades;
    }
}

