class Solution {
    /**
     * Given an array of non-negative integers, return a copy of the given array after sorting,
     * you will sort the given array in ascending order if the sum( first index value, last index value) is odd,
     * or sort it in descending order if the sum( first index value, last index value) is even.
     *
     * Note:
     * don't change the given array.
     */
    public List<Integer> sort_array(List<Integer> array) {
        if (array == null || array.size() <= 1) {
            return new ArrayList<>(array);
        }

        int first = array.get(0);
        int last = array.get(array.size() - 1);

        // Determine sorting order based on sum of first and last elements
        boolean isOddSum = (first + last) % 2 != 0;

        List<Integer> sortedArray = new ArrayList<>(array);

        if (isOddSum) {
            Collections.sort(sortedArray);  // Ascending order
        } else {
            Collections.sort(sortedArray, Collections.reverseOrder());  // Descending order
        }

        return sortedArray;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.sort_array(new ArrayList<>(List.of())).equals(List.of()),
                s.sort_array(new ArrayList<>(List.of(5))).equals(List.of(5)),
                s.sort_array(new ArrayList<>(Arrays.asList(2, 4, 3, 0, 1, 5))).equals(Arrays.asList(0, 1, 2, 3, 4, 5)),
                s.sort_array(new ArrayList<>(Arrays.asList(2, 4, 3, 0, 1, 5, 6))).equals(Arrays.asList(6, 5, 4, 3, 2, 1, 0)),
