            List<Integer> row = lst.get(rowIdx);
            for (int colIdx = 0; colIdx < row.size(); colIdx++) {
                if (row.get(colIdx) == x) {
                    coordinates.add(Arrays.asList(rowIdx, row.size() - 1 - colIdx));
                }
            }
        }

        // Sort by rows in ascending order and columns in descending order
        Collections.sort(coordinates, new Comparator<List<Integer>>() {
            @Override
            public int compare(List<Integer> o1, List<Integer> o2) {
                if (!o1.get(0).equals(o2.get(0))) {
                    return Integer.compare(o1.get(0), o2.get(0));
                } else {
                    return Integer.compare(o2.get(1), o1.get(1)); // descending order for columns
                }
            }
        });

        return coordinates;
    }
}

