class Solution {
    /**
    Write a function that takes a message, and encodes in such a
    way that it swaps case of all letters, replaces all vowels in
    the message with the letter that appears 2 places ahead of that
    vowel in the english alphabet.
    Assume only letters.

    Examples:
    >>> encode("test")
    "TGST"
    >>> encode("This is a message")
    "tHKS KS C MGSSCGG"
     */
    public String encode(String message) {
        Map<Character, Character> vowels = new HashMap<>();
        vowels.put('a', 'c');
        vowels.put('e', 'g');
        vowels.put('i', 'k');
        vowels.put('o', 'q');
        vowels.put('u', 'w');
        vowels.put('A', 'C');
        vowels.put('E', 'G');
        vowels.put('I', 'K');
        vowels.put('O', 'Q');
        vowels.put('U', 'W');

        StringBuilder encodedMessage = new StringBuilder();

        for (char c : message.toCharArray()) {
            if (vowels.containsKey(c)) {
                // Replace the vowel with the corresponding letter
                char encodedChar = vowels.get(c);
                encodedMessage.append(encodedChar);
            } else {
                // Swap case of non-vowel characters
                if (Character.isLowerCase(c)) {
                    encodedMessage.append(Character.toUpperCase(c));
                } else {
                    encodedMessage.append(Character.toLowerCase(c));
                }
            }
        }

        return encodedMessage.toString();
    }
}

