    /**
    You are given two positive integers n and m, and your task is to compute the
    average of the integers from n through m (including n and m).
    Round the answer to the nearest integer and convert that to binary.
    If n is greater than m, return -1.
    Example:
    rounded_avg(1, 5) => "11"
    rounded_avg(7, 5) => -1
    rounded_avg(10, 20) => "1111"
    rounded_avg(20, 33) => "11011"
     */
    public Object rounded_avg(int n, int m) {
        if (n > m) {
            return -1;
        }

        long totalSum = 0;
        for (int i = n; i <= m; i++) {
            totalSum += i;
        }

        int count = m - n + 1;
        double average = Math.round((double)totalSum / count);
        String binaryAverage = Integer.toBinaryString((int)average);

        return binaryAverage;
    }
}

