class Solution {
    /**
     Given a list of positive integers x. return a sorted list of all
     elements that hasn't any even digit.

     Note: Returned list should be sorted in increasing order.

     For example:
     >>> unique_digits(Arrays.asList(15, 33, 1422, 1))
     [1, 15, 33]
     >>> unique_digits(Arrays.asList(152, 323, 1422, 10))
     []
      */
    public List<Integer> unique_digits(List<Integer> x) {
        List<Integer> result = new ArrayList<>();

        for (Integer num : x) {
            if (!hasEvenDigit(num)) {
                result.add(num);
            }
        }

        Collections.sort(result);
        return result;
    }

    private boolean hasEvenDigit(int n) {
        while (n > 0) {
            int digit = n % 10;
            if (digit % 2 == 0) {
                return true;
            }
            n /= 10;
        }
        return false;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.unique_digits(Arrays.asList(15, 33, 1422, 1)).equals(Arrays.asList(1, 15, 33)),
                s.unique_digits(Arrays.asList(152, 323, 1422, 10)).equals(List.of()),
                s.unique_digits(Arrays.asList(12345, 2033, 111, 151)).equals(Arrays.asList(111, 151)),
                s.unique_digits(Arrays.asList(135, 103, 31)).equals(Arrays.asList(31, 135))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

