class Solution {
    /**
     * Helper method to calculate the factorial of a number.
     */
    private int factorial(int num) {
        if (num == 0 || num == 1) {
            return 1;
        } else {
            return num * factorial(num - 1);
        }
    }

    /**
     * Helper method to calculate the sum of numbers from 1 to a given number.
     */
    private int sumOfNumbers(int num) {
        int sum = 0;
        for (int i = 1; i <= num; i++) {
            sum += i;
        }
        return sum;
    }

    /**
     * Main method that returns a list of size n, where each element is either the factorial or the sum based on index.
     */
    public List<Integer> f(int n) {
        List<Integer> result = new ArrayList<>();
        for (int i = 1; i <= n; i++) {
            if (i % 2 == 0) {
                result.add(factorial(i));
            } else {
                result.add(sumOfNumbers(i));
            }
        }
        return result;
    }
}

