class Solution {
    public boolean move_one_ball(List<Integer> arr) {
        if (arr.isEmpty()) {
            return true;
        }

        int n = arr.size();
        for (int i = 0; i < n; i++) {
            // Check if array is sorted after rotation by 'i' positions.
            List<Integer> rotatedArr = new ArrayList<>(arr.subList(i, n));
            rotatedArr.addAll(arr.subList(0, i));

            boolean isSorted = true;
            for (int j = 0; j < rotatedArr.size() - 1; j++) {
                if (rotatedArr.get(j) > rotatedArr.get(j + 1)) {
                    isSorted = false;
                    break;
                }
            }

            if (isSorted) {
                return true;
            }
        }
        return false;
    }
}

