class Solution {
    /**
     * Given a string representing a space separated lowercase letters, return a dictionary
     * of the letter with the most repetition and containing the corresponding count.
     * If several letters have the same occurrence, return all of them.
     */
    public Map<String, Integer> histogram(String test) {
        if (test.isEmpty()) {
            return new HashMap<>();
        }

        // Splitting the string into individual letters.
        String[] words = test.split(" ");

        // Using a map to count occurrences of each letter.
        Map<String, Integer> counts = new HashMap<>();
        for (String word : words) {
            counts.put(word, counts.getOrDefault(word, 0) + 1);
        }

        // Finding the maximum occurrence value.
        int maxCount = Collections.max(counts.values());

        // Filtering out letters that have the maximum occurrence and creating a result map.
        Map<String, Integer> result = new HashMap<>();
        for (Map.Entry<String, Integer> entry : counts.entrySet()) {
            if (entry.getValue() == maxCount) {
                result.put(entry.getKey(), entry.getValue());
            }
        }

        return result;
    }
}

