                s.reverse_delete("vabba", "v" ).equals(Arrays.asList("abba", true)),
                s.reverse_delete("mamma", "mia" ).equals(Arrays.asList("", true))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

