    /**
     * Given a list of strings, where each string consists of only digits,
     * return a list. Each element i of the output should be "the number of odd elements in the
     * string i of the input." where all the i's should be replaced by the number
     * of odd digits in the i"th string of the input.
     */
    public List<String> odd_count(List<String> lst) {
        List<String> result = new ArrayList<>();

        for (String s : lst) {
            int count = 0;
            // Counting the number of odd digits
            for (char c : s.toCharArray()) {
                if (c == '1' || c == '3' || c == '5' || c == '7' || c == '9') {
                    count++;
                }
            }

            // Formatting the output string with the count of odd elements
            String outputStr = "the number of odd elements " + count +
                               "n the str" + count + 
                               "ng " + count + 
                               " of the " + count + 
                               "nput.";

            result.add(outputStr);
        }

        return result;
    }
}

