class Solution {
    /**
    Given an array of integers nums, find the minimum sum of any non-empty sub-array
    of nums.
    Example
    minSubArraySum(Arrays.asList(2, 3, 4, 1, 2, 4)) == 1
    minSubArraySum(Arrays.asList(-1, -2, -3)) == -6
     */
    public int minSubArraySum(List<Integer> nums) {
        if (nums == null || nums.isEmpty()) {
            return 0;
        }

        int current_sum = Integer.MAX_VALUE;
        int min_sum = Integer.MAX_VALUE;

        for (int num : nums) {
            // Update current sum, reset to the current number if it's less than adding the current number
            current_sum = Math.min(num, current_sum + num);
            // Track the minimum sum found so far
            min_sum = Math.min(min_sum, current_sum);
        }

        return min_sum;
    }
}

