class Solution {
    public int max_fill(List<List<Integer>> grid, int capacity) {
        List<List<Integer>> transposedGrid = new ArrayList<>();

        // Transpose the grid
        for (int i = 0; i < grid.get(0).size(); i++) {
            List<Integer> well = new ArrayList<>();
            for (List<Integer> row : grid) {
                well.add(row.get(i));
            }
            transposedGrid.add(well);
        }

        int totalDrops = 0;

        // Calculate drops needed per well
        for (List<Integer> well : transposedGrid) {
            int waterUnits = 0;
            for (int unit : well) {
                waterUnits += unit;
            }
            int dropsNeeded = (waterUnits + capacity - 1) / capacity;
            totalDrops += dropsNeeded;
        }

        return totalDrops;
    }
}

