      */
    public boolean is_sorted(List<Integer> lst) {
        if (lst.size() <= 1) {
            return true;
        }

        Map<Integer, Integer> count = new HashMap<>();
        for (int num : lst) {
            count.put(num, count.getOrDefault(num, 0) + 1);
            if (count.get(num) > 2) {
                return false;
