     * tri(1) = 3
     * tri(n) = 1 + n / 2, if n is even.
     * tri(n) =  tri(n - 1) + tri(n - 2) + tri(n + 1), if n is odd.
     */
    public List<Integer> tri(int n) {
        List<Integer> result = new ArrayList<>(Collections.nCopies(n + 1, 1));

        if (n == 0) {
            return result;
        }

        result.set(1, 3);

        for (int i = 2; i <= n; i++) {
            if (i % 2 == 0) {
                result.set(i, 1 + i / 2);
