                // Note: This part is incorrect as per the definition. The Tribonacci sequence
                // should not reference tri(n+1). It's a mistake in the problem statement.
                // For now, we'll assume it to be tri(n-3) for demonstration purposes.
                result.set(i, result.get(i - 1) + result.get(i - 2) + (i >= 4 ? result.get(i - 3) : 0));
            }
        }

        return result;
    }
}

