class Solution {
    public List<Integer> tri(int n) {
        if (n == 0) {
            return Arrays.asList(1);
        }

        List<Integer> result = new ArrayList<>(Collections.nCopies(n + 1, 1));
        result.set(1, 3);

        for (int i = 2; i <= n; i++) {
            if (i % 2 == 0) {
                result.set(i, 1 + i / 2);
            } else {
                // Special handling for the last element
                int nextValue = (i < n) ? result.get(i + 1) : 1;
                result.set(i, result.get(i - 1) + result.get(i - 2) + nextValue);
            }
        }

        return result;
    }
}

