     real numbers, and returns the larger variable in its given variable type.
     Return None if the values are equal.
     Note: If a real number is represented as a string, the floating point might be . or ,

     compare_one(1, 2.5) -> Optional.of(2.5)
     compare_one(1, "2,3") -> Optional.of("2,3")
     compare_one("5,1", "6") -> Optional.of("6")
     compare_one("1", 1) -> Optional.empty()
      */
    public Optional<Object> compare_one(Object a, Object b) {
        double aVal = convertToDouble(a);
        double bVal = convertToDouble(b);

        if (aVal > bVal) {
            return Optional.ofNullable(a);
        } else if (bVal > aVal) {
            return Optional.ofNullable(b);
        } else {
            return Optional.empty();
        }
    }

    private double convertToDouble(Object value) {
        if (value instanceof String) {
            String strValue = ((String) value).replace(',', '.');
            return Double.parseDouble(strValue);
        } else if (value instanceof Integer) {
            return ((Integer) value).doubleValue();
        } else if (value instanceof Float || value instanceof Double) {
            return ((Number) value).doubleValue();
        }
        throw new IllegalArgumentException("Unsupported type: " + value.getClass().getName());
    }
}

