class Solution {
    /**
    You are given a positive integer n. You have to create an integer array a of length n.
        For each i (1 <= i <= n), the value of a[i] = i * i - i + 1.
        Return the number of triples (a[i], a[j], a[k]) of a where i < j < k,
    and a[i] + a[j] + a[k] is a multiple of 3.

    Example :
        Input: n = 5
        Output: 1
        Explanation:
        a = [1, 3, 7, 13, 21]
        The only valid triple is (1, 7, 13).
     */
    public int get_max_triples(int n) {
        // Generate the array 'a' where each element a[i] = i * i - i + 1
        List<Integer> a = new ArrayList<>();
        for (int i = 1; i <= n; i++) {
            a.add(i * i - i + 1);
        }

        int count = 0;
        // Iterate over all possible triples (i, j, k) where i < j < k
        for (int i = 0; i < n-2; i++) {
            for (int j = i+1; j < n-1; j++) {
                for (int k = j+1; k < n; k++) {
                    // Check if the sum of elements at indices i, j, and k is divisible by 3
                    if ((a.get(i) + a.get(j) + a.get(k)) % 3 == 0) {
                        count++;
                    }
                }
            }
        }

        return count;
    }
}

