     * lst_A[j] = lst_B[j].
     * It is guaranteed that the answer is unique.
     * Return an ordered list of the values on the cells that the minimum path go through.
     */
    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        int N = grid.size();

        // Initialize a 3D array for storing minimum paths.
        @SuppressWarnings("unchecked")
        List<Integer>[][][] dp = (List<Integer>[][][]) new List[N][N][k + 1];

        // Directions to move up, down, left and right
        int[][] directions = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};

        for (int i = 0; i < N; ++i) {
            for (int j = 0; j < N; ++j) {
                dfs(grid, dp, directions, i, j, 1);
            }
        }

        // Initialize the minimum path to a very large value.
        List<Integer> result = new ArrayList<>(Collections.nCopies(k, Integer.MAX_VALUE));

        for (int i = 0; i < N; ++i) {
            for (int j = 0; j < N; ++j) {
                if (dp[i][j][1] != null && comparePaths(dp[i][j][1], result)) {
                    result = new ArrayList<>(dp[i][j][1]);
                }
            }
        }

        return result;
    }

    private List<Integer> dfs(List<List<Integer>> grid, List<Integer>[][][] dp, int[][] directions, int x, int y, int steps) {
        if (steps == 0) {
            return new ArrayList<>();
        }

        if (dp[x][y][steps] != null) {
            return dp[x][y][steps];
        }

        List<Integer> minPath = null;
        for (int[] dir : directions) {
            int nx = x + dir[0], ny = y + dir[1];
            if (nx >= 0 && nx < grid.size() && ny >= 0 && ny < grid.get(0).size()) {
                List<Integer> path = dfs(grid, dp, directions, nx, ny, steps - 1);
                if (path != null) {
                    List<Integer> newPath = new ArrayList<>(Collections.singletonList(grid.get(x).get(y)));
                    newPath.addAll(path);
                    if (minPath == null || comparePaths(newPath, minPath)) {
                        minPath = newPath;
                    }
                }
            }
        }

        dp[x][y][steps] = minPath;
        return minPath;
    }

    private boolean comparePaths(List<Integer> a, List<Integer> b) {
        for (int i = 0; i < Math.min(a.size(), b.size()); ++i) {
            if (!a.get(i).equals(b.get(i))) {
                return a.get(i) < b.get(i);
            }
        }
        return false;
    }
}

