class Solution {
    /**
     * Calculates the sum of digits for an integer.
     */
    private int sumOfDigits(int n) {
        String numStr = Integer.toString(n);
        int sum = 0;
        boolean isNegative = false;

        if (numStr.charAt(0) == '-') {
            isNegative = true;
            sum -= Character.getNumericValue(numStr.charAt(1));
        }

        for (int i = isNegative ? 2 : 0; i < numStr.length(); i++) {
            sum += Character.getNumericValue(numStr.charAt(i));
        }
        return sum;
    }

    /**
     * Orders the list of integers based on the sum of their digits.
     */
    public List<Integer> order_by_points(List<Integer> nums) {
        List<Pair<Integer, Integer>> numsWithSum = new ArrayList<>();

        for (int i = 0; i < nums.size(); i++) {
            int num = nums.get(i);
            int digitSum = sumOfDigits(num);
            numsWithSum.add(new Pair<>(num, digitSum));
        }

        Collections.sort(numsWithSum, Comparator.comparing((Pair<Integer, Integer> p) -> p.getValue())
                                                  .thenComparingInt(Pair::getKey));

        List<Integer> sortedNums = new ArrayList<>();
        for (Pair<Integer, Integer> pair : numsWithSum) {
            sortedNums.add(pair.getKey());
        }

        return sortedNums;
    }

    private static class Pair<K extends Comparable<K>, V extends Comparable<V>> implements Comparable<Pair<K,V>> {
        K key;
        V value;

        public Pair(K key, V value) {
            this.key = key;
            this.value = value;
        }

        public K getKey() { return key; }
        public V getValue() { return value; }

        @Override
        public int compareTo(Pair<K,V> o) {
            int cmp = key.compareTo(o.getKey());
            if (cmp == 0)
                return value.compareTo(o.getValue());
            else
                return cmp;
        }
    }
}

