class Solution {
    /**
     * Helper method to calculate sum of digits.
     */
    private int sumOfDigits(int n) {
        return Arrays.stream(String.valueOf(n).split(""))
                     .mapToInt(Integer::parseInt)
                     .sum();
    }

    public List<Integer> order_by_points(List<Integer> nums) {
        List<int[]> numsWithIndex = new ArrayList<>();
        for (int i = 0; i < nums.size(); i++) {
            int num = nums.get(i);
            numsWithIndex.add(new int[]{num, i, sumOfDigits(num)});
        }

        Collections.sort(numsWithIndex, Comparator.comparingInt((int[] arr) -> arr[2])
                                                    .thenComparingInt(arr -> arr[1]));

        List<Integer> result = new ArrayList<>();
        for (int[] tuple : numsWithIndex) {
            result.add(tuple[0]);
        }
        return result;
    }
}

