            public int compare(String s1, String s2) {
                int lenCompare = Integer.compare(s1.length(), s2.length());
                if (lenCompare != 0) {
                    return lenCompare;
                } else {
                    return s1.compareTo(s2);
                }
            }
        });

        return filteredList;
    }
