class Solution {
    /**
    Given an integer. return a tuple that has the number of even and odd digits respectively.

     Example:
        even_odd_count(-12) ==> (1, 1)
        even_odd_count(123) ==> (1, 2)
     */
    public List<Integer> even_odd_count(int num) {
        // Convert number to string and remove any negative sign
        String strNum = Integer.toString(Math.abs(num));

        int evenCount = 0;
        int oddCount = 0;

        // Iterate through each digit in the string representation of the number
        for (int i = 0; i < strNum.length(); i++) {
            char ch = strNum.charAt(i);
            int digit = Character.getNumericValue(ch);

            // Check if the digit is even or odd and update respective counter
            if (digit % 2 == 0) {
                evenCount++;
            } else {
                oddCount++;
            }
        }

        List<Integer> result = new ArrayList<>();
        result.add(evenCount);
        result.add(oddCount);

        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.even_odd_count(7).equals(Arrays.asList(0, 1)),
                s.even_odd_count(-78).equals(Arrays.asList(1, 1)),
                s.even_odd_count(3452).equals(Arrays.asList(2, 2)),
                s.even_odd_count(346211).equals(Arrays.asList(3, 3)),
                s.even_odd_count(-345821).equals(Arrays.asList(3, 3)),
                s.even_odd_count(-2).equals(Arrays.asList(1, 0)),
                s.even_odd_count(-45347).equals(Arrays.asList(2, 3)),
                s.even_odd_count(0).equals(Arrays.asList(1, 0))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

