import javax.script.ScriptEngineManager;
import javax.script.ScriptEngine;
import javax.script.ScriptException;

class Solution {
    /**
     Given two lists operator, and operand. The first list has basic algebra operations,
     and the second list is a list of integers. Use the two given lists to build the algebric
     expression and return the evaluation of this expression.

     The basic algebra operations:
     Addition ( + )
     Subtraction ( - )
     Multiplication ( * )
     Floor division ( / )
     Exponentiation ( ** )

     Example:
     operator["+", "*", "-"]
     array = [2, 3, 4, 5]
     result = 2 + 3 * 4 - 5
     => result = 9

     Note:
         The length of operator list is equal to the length of operand list minus one.
         Operand is a list of non-negative integers.
         Operator list has at least one operator, and operand list has at least two operands.
      */
    public int do_algebra(List<String> operator, List<Integer> operand) {
        StringBuilder expression = new StringBuilder();
        expression.append(operand.get(0));

        for (int i = 0; i < operator.size(); i++) {
            String op = operator.get(i);
            if ("**".equals(op)) {
                expression.append(" ").append("*").append("*").append(" ").append(operand.get(i + 1));
            } else {
                expression.append(" ").append(op).append(" ").append(operand.get(i + 1));
            }
        }

        return evaluateExpression(expression.toString());
    }

    private int evaluateExpression(String expression) {
        ScriptEngineManager mgr = new ScriptEngineManager();
        ScriptEngine engine = mgr.getEngineByName("JavaScript");
        try {
            return ((Number)engine.eval(expression)).intValue();
        } catch (ScriptException e) {
            throw new RuntimeException(e);
        }
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.do_algebra(new ArrayList<>(Arrays.asList("**", "*", "+")), new ArrayList<>(Arrays.asList(2, 3, 4, 5))) == 37,
                s.do_algebra(new ArrayList<>(Arrays.asList("+", "*", "-")), new ArrayList<>(Arrays.asList(2, 3, 4, 5))) == 9,
                s.do_algebra(new ArrayList<>(Arrays.asList("/", "*")), new ArrayList<>(Arrays.asList(7, 3, 4))) == 8,
                s.do_algebra(new ArrayList<>(Arrays.asList("+", "**", "**")), new ArrayList<>(Arrays.asList(7, 5, 3, 2))) == 1953132
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

