import java.lang.*;
import java.security.MessageDigest;
import java.security.NoSuchAlgorithmException;
import java.util.Optional;

class Solution {
    /**
     * Given a string "text", return its md5 hash equivalent string with length being 32.
     * If "text" is an empty string, return Optional.empty().
     *
     * >>> string_to_md5("Hello world") == "3e25960a79dbc69b674cd4ec67a72c62"
     */
    public Optional<String> string_to_md5(String text) throws NoSuchAlgorithmException {
        if (text.isEmpty()) {
            return Optional.empty();
        }

        MessageDigest md = MessageDigest.getInstance("MD5");
        byte[] messageDigest = md.digest(text.getBytes());

        StringBuilder hexString = new StringBuilder();
        for (byte b : messageDigest) {
            String hex = Integer.toHexString(0xff & b);
            if (hex.length() == 1) hexString.append('0');
            hexString.append(hex);
        }

        return Optional.of(hexString.toString());
    }
}

public class Main {
    public static void main(String[] args) throws NoSuchAlgorithmException {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.string_to_md5("Hello world").get().equals("3e25960a79dbc69b674cd4ec67a72c62"),
                s.string_to_md5("").isEmpty(),
                s.string_to_md5("A B C").get().equals("0ef78513b0cb8cef12743f5aeb35f888"),
                s.string_to_md5("password").get().equals("5f4dcc3b5aa765d61d8327deb882cf99")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

